        if city == 'New York':
            person['location'] = 'East Coast'
        elif city == 'Los Angeles':
            person['location'] = 'West Coast'
        elif city == 'Chicago':
            person['location'] = 'Midwest'
        elif city == 'Houston':
            person['location'] = 'South'
        else:
            person['location'] = 'Other'
    return data

